import React from 'react';
import { Card } from 'flowbite-react';

const Documentation = () => {
  return (
    <Card>
      <Card.Header>
        <h2>Documentation and Help</h2>
      </Card.Header>
      <Card.Body>
        <h3>KubeHub</h3>
        <p>Here you can add information on how to use KubeHub, including how to search and clone repositories.</p>

        <h3>KubeSH</h3>
        <p>Here you can add information on how to use KubeSH, including how to start a collaborative session.</p>

        <h3>KubeIA</h3>
        <p>Here you can add information on how to use KubeIA, including how to analyze and optimize Docker containers.</p>

        <h3>KubeFlow</h3>
        <p>Here you can add information on how to use KubeFlow, including how to visualize metrics and detect bottlenecks.</p>
      </Card.Body>
    </Card>
  );
};

export default Documentation;
